import React from "react";
import s from "./Smester.module.css";

const Semester = ({semester}) => {
    return (
        <div>
            {semester.map(s => 
                <div className={s.conteinerSemester}>
                    <li>Семестр №: {s.num_semester}</li>
                </div>
            )}
        </div>
    )
}

export default Semester;
